        return new Twig_Source("{% extends 'admin/admin.home.html.twig' %}

{% block title %}Admin - New blog entry{% endblock %}

{% block body %}
    <div class=\"row container\">

        {% block headercontent %}
            <div class=\"col s12 header-info\">
                <div class=\"col s12 divider pink-p\"></div>

                <div class=\"col s12 paramBlog\">
                    <h3>Création d'entrée de blog</h3>
                </div>

                <div class=\"col s12 divider pink-p divider-bottom\"></div>
            </div>
        {% endblock %}

        {% block form %}
            <div class=\"col s12 content\">
                {{ form_start(form) }}

                <div class=\"col m6 s12\">{{ form_row(form.id_cat, {'type': 'range', 'attr': {'min': '0', 'max': '10'}}) }}</div>
                <div class=\"col m6 s12\">{{ form_row(form.author, {'autocomplete': 'false'}) }}</div>
                <div class=\"col s12\">{{ form_row(form.title) }}</div>
                <div id=\"editor\" class=\"col s12\">{{ form_row(form.content, {'label': false}) }}</div>

                <div class=\"col s12 divider pink-p divider-bottom\"></div>

                <div class=\"col s12 paramBlog\">
                    <div>{{ form_row(form.status, {'type': 'radio'}) }}</div>
                    <div>
                        <button class=\"btn waves-effect waves-light\" type=\"submit\" name=\"action\">Enregistrer
                            <i class=\"material-icons right\">send</i>
                        </button>
                    </div>
                </div>

                {{ form_end(form) }}
            </div>
        {% endblock %}

    </div>
{% endblock %}

{% block javascripts %}
    <script src=\"../ckeditor4/ckeditor.js\"></script>
